class bathroom_code:

    keypad = [
        ['1', '2', '3'],
        ['4', '5', '6'],
        ['7', '8', '9'],
    ]

    def __repr__(self):
        return "This magical device sorts out what the bathroom code is"

    def __init__(self):
        self.x_position = 1
        self.y_position = 1

    def move(self, movement):
        # Options: U D R L, no diagonal
        if movement == 'U' and self.y_position == 0:
            pass
        elif movement == 'U':
            self.y_position -= 1
        elif movement == 'D' and self.y_position == 2:
            pass
        elif movement == 'D':
            self.y_position += 1
        elif movement == 'L' and self.x_position == 0:
            pass
        elif movement == 'L':
            self.x_position -= 1
        elif movement == 'R' and self.x_position == 2:
            pass
        elif movement == 'R':
            self.x_position += 1
        else:
            raise Exception

    def print_key(self):
        return self.keypad[self.y_position][self.x_position]

if __name__ == '__main__':

    keypad = bathroom_code()
    # Let's ignore pep8 line length for simplicity....
    input = [
        '',
        '',
        '',
        '',
        ''
    ]

    # input = [
    #     'ULL',
    #     'RRDDD',
    #     'LURDL',
    #     'UUUUD'
    # ]
    for i in input:
        for x in i:
            keypad.move(x)

        print(keypad.print_key())